    return(
        <div className={cl.main}>
        <svg  className={cl.svg} viewBox="0 0 90 10">

        <path  d={PATH}/>
       
        </svg>
        <div>
        <input  value={inputThing} onChange={(e)=>{setSearch(e.target.value)}} type="text" placeholder="Найти запчасть"className={cl.input}> 
        {console.log(list)}
         
        
        </input> 
        <div className={search.length>=1?cl.list:cl.list__none}>
            {list.map((p)=><p  onClick={()=>setSearch(p.name)}>{p.name}</p>)}
        </div>
        </div> 
        </div> 
    )
}


export default MySearch;
